import React, { useState } from 'react';
import UserInput from './Components/Users/UserInput/UserInput';
import UserList from './Components/Users/UserList/UserList';

function App() {

  const [user, setUser] = useState([
    {name: 'Haseeb', age: 21},
    {name: 'Kunal', age: 30}
  ]);

  return (
    <div>
        <UserInput />
        <UserList users={user}/>
    </div>
  );
}

export default App;
